import * as React from 'react';
import {
  Text,
  View,
  StyleSheet,
  TextInput,
  TouchableOpacity,
  Image,
} from 'react-native';
import { Header } from 'react-native-elements';
import { SafeAreaProvider } from 'react-native-safe-area-context';
export default class HomeScreen extends React.Component {
  constructor() {
    super();
    this.state = {
      text: '',
      isSearchPressed:'' ,
      word: ' ',
      lexicalCategory: '',
      examples: [],
      definition: ''
    };
  }

  getWord=(word)=>{

var searchKeyword = word.toLowerCase()
var url = 'https://rupinwhitehatjr.github.io/dictionary/' + searchKeyword + '.json'

return fetch(url)
.then((data)  => {

  if(data.status ===200)
  {
    return data.json()
  }
  else 
  {
    return null
  }

})

.then((response)=>{

var responseObject = response

if(responseObject){
var wordData = responseObject.definitions[0]

var definition = wordData.description
var lexicalCategory=wordData.wordtype

this.setState({
'word' : this.state.text,
'definition': definition,
'lexicalCategory': lexicalCategory
})

}

else{

  this.setState({
'word' : this.state.text,
'definition': 'Not Found'

  })

}

}

)

  }

  render() {
    return (
      
      <SafeAreaProvider>
      <View style={styles.container}>

      <Header
            
            backgroundColor={'yellow'}
            centerComponent={{
              text: 'Online Dictionary App',
              style: { color: 'Black', fontSize: 20, fontWeight: 'bold' },
            }}
      /> 

        <Image
          style={styles.image}
          source={{
            uri:
              'data:image/png;base64,',
          }}
        />


        <TextInput
          style={styles.inputBox}
          onChangeText={text => {
            this.setState({ 
              text: text,
              isSearchPressed: false,
              word: ' Loading...',
              lexicalCategory: '',
              examples: [],
              definition: ''

            });
          }}
          value={this.state.text}
        />

        <TouchableOpacity
          style={styles.goButton}
          onPress={() => {
            this.setState({ isSearchPressed: true });
            this.getWord(this.state.text)
          }}>
          <Text style={styles.buttonText}>Search Word</Text>
        </TouchableOpacity>
        <Text style={styles.displayText}>
           
         {this.state.displayText}
          
          </Text>
      
<View>
<Text style ={styles.grammar}>
          Word:{''}

          </Text>

          <Text style = {styles.meanings}>
          {this.state.word}
          </Text>

</View>

<View>
<Text style ={styles.grammar}>
          Type:{''}

          </Text>

          <Text style = {styles.meanings}>
          {this.state.lexicalCategory}
          </Text>

</View>

<View>
<Text style ={styles.grammar}>
          Definition:{''}

          </Text>

          <Text style = {styles.meanings}>
          {this.state.definition}
          </Text>

</View>

      </View>

      </SafeAreaProvider>

    );
  }
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: 'rgb(50,100,70)',
  },
  inputBox: {
    marginTop: '1%',
    width: '80%',
    alignSelf: 'center',
    height: 40,
    textAlign: 'center',
    borderWidth: 2 ,
    outline: 'none',
    
  },
  goButton: {
    width: '10%',
    height: 55,
    alignSelf: 'center',
    padding: 10,
    margin: 10,
    backgroundColor: 'rgb(250,20,10)' ,
    borderRadius: 40,
  },
  buttonText: {
    textAlign: 'center',
    fontSize: 20,
    fontWeight: 'bold',
  },
  displayText: {
    textAlign: 'center',
    fontSize: 30,
  },
  grammar: {
    marginLeft:'15%',
    marginTop: '4%',
    fontSize: 20,
   },

   meanings: {
    marginLeft:'30%',
    marginTop: '0%',
    fontSize: 15,
   },

   image: {
    width: 200,
    height: 200,
    marginTop: '2%',
    alignSelf: 'center'
  }




});

